import { createBrowserRouter, createRoutesFromElements, Outlet, Route, RouterProvider, Routes } from "react-router-dom";
import NotFound from "../component/NotFound/NotFound.jsx";
import Home from "../component/Home/Home.jsx";
import Cart from "../component/cart/Cart.jsx";
import Auth from "../component/Auth/Auth.jsx";
import Profile from "../component/profile/Profile.jsx";
import UserProfile from "../component/profile/UserProfile.jsx";
import Orders from "../component/profile/Orders.jsx";
import Favourites from "../component/profile/Favourites.jsx";
import Address from "../component/profile/Address.jsx";
import Events from "../component/profile/Address.jsx";
import { Logout } from "@mui/icons-material";
import Navbar from "../component/navbar/Navbar.jsx";
import Layout from "../Layout.jsx";
import AdminRoutes from "./AdminRoutes.jsx";
import { useSelector } from "react-redux";
import Admin from "../Admin/Admin.jsx";
import AdminRouters from "./AdminRoutes.jsx";
import CustomerRoutes from "./CustomerRoutes.jsx";
import CreateRestaurant from "../Admin/AddRestaurants/CreateRestaurant.jsx";


const AdminElement = () => {
    const { restaurant } = useSelector((store) => store);
    return restaurant.usersRestaurant ? <Admin /> : <CreateRestaurant />;
};

const CustomerLayout = () => (
    <div className="relative">
        <nav className="sticky top-0 z-50">
            <Navbar />
        </nav>
        <Outlet />
    </div>
);
const Routers = () => {
    const { auth } = useSelector((store) => store);
    return (
        <>
            <Routes>
                <Route
                    path="/admin/restaurant/*"
                    element={<AdminRouters />}
                />
                <Route path="/*" element={<CustomerRoutes />} />
            </Routes>
        </>

    );
};

export default Routers;
